import {Detail} from "./Detail"


export const Szak=({match})=>{
    //console.log(Object.keys(match.params))
    return(
        <React.Fragment>
            <Detail key={match.params.id} szakId={match.params.id}/>
        </React.Fragment>
       )  
}
